import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('../fonts/rijksoverheidsansheading-bold-bold.ttf', font);
this.addFont('../fonts/rijksoverheidsansheading-bold-bold.ttf', 'rijksoverheidsansheading-bold', 'bold');
};
jsPDF.API.events.push(['addFonts', callAddFont])
